import React from "react";
import ReactDOM from "react-dom";
import SectionHeader from "./SectionHeader";
import FAQ from "./FAQ";

class FrequentlyAsked extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      faq: ["", "", "", ""],
      answer: [
        "This is a testing answer, not much meaning 1",
        "This is a testing answer, not much meaning 2",
        "This is a testing answer, not much meaning 3",
        "This is a testing answer, not much meaning 4",
        "This is a testing answer, not much meaning 5",
      ],
    };
  }
  render() {
    const { faq, answer } = this.state;
    return (
      <div className="container pb-5 mb-5">
        <SectionHeader headerName="Frequently asked questions " />
        {faq.map((i, index) => {
          return (
            <FAQ
              name="this is just a testing message and not having much meaning "
              detail="Okay this is the default text for the FAQ "
              answer={answer[index]}
            />
          );
        })}
      </div>
    );
  }
}

export default FrequentlyAsked;
